import redis from 'redis';

class RedisClient {
  constructor() {
    this.client = redis.createClient(); // Creates the Redis client
    // Display errors in the console
    this.client.on('error', (err) => {
      console.error('Redis error: ', err);
    });
  }

  // Check if the connection to Redis is alive
  isAlive() {
    return this.client.connected; // Returns true if Redis connection is alive, otherwise false
  }

  // Get a value from Redis by key
  async get(key) {
    return new Promise((resolve, reject) => {
      this.client.get(key, (err, value) => {
        if (err) {
          reject(err);
        } else {
          resolve(value);
        }
      });
    });
  }

  // Set a key-value pair with expiration time in Redis
  async set(key, value, duration) {
    return new Promise((resolve, reject) => {
      this.client.setex(key, duration, value, (err, reply) => {
        if (err) {
          reject(err);
        } else {
          resolve(reply);
        }
      });
    });
  }

  // Delete a key-value pair from Redis
  async del(key) {
    return new Promise((resolve, reject) => {
      this.client.del(key, (err, reply) => {
        if (err) {
          reject(err);
        } else {
          resolve(reply);
        }
      });
    });
  }
}

// Create and export the RedisClient instance
const redisClient = new RedisClient();
export default redisClient;
